import React, { Component } from 'react'
import logo from "../img/logo.png"


export default class Landing extends Component {
    render() {
        return (
            <div className="main_page">
               <img src={logo} width="500" style={{marginTop:"200px"}}/> 
            </div>
        )
    }
}
